import "../App.css";
import "../style/LandingPage.css";
import UserComponent from "../components/UserComponent";

function firstpage() {
  return (
    <div>
      <h1>Selamat Datang di AksaraKU</h1>
      <p>
        Silahkan masuk atau daftar terlebih dahulu sebelum memulai pembelajaran
      </p>
      <button>
        <a href="/daftar" class="btn btn-custom">
          daftar
        </a>
      </button>
      <button>
        <a href="/masuk" class="btn btn-custom">
          masuk
        </a>
      </button>
    </div>
  );
}

export default firstpage;
